"""**Explica√ß√£o do resultado** OLS (*Ordinary Least Squares*)
![aula7fig1.jpeg](data:image/jpeg;base64,)

De acordo com as informa√ß√µes o $r^2=0,931$ o que indica que uma porcentagem de 93,1 \% de rela√ß√£o da quantidade de got√≠culas de n√©voa em fun√ß√£o da velocidade do fluxo.

A reta de regress√£o √© $Y= 0,4041 + 0,0006x$

Verificar calculando manualmente
"""

#@title fun√ß√£o linreg
#O seguinte c√≥digo pode tamb√©m ser usado previamente para calcular SQE, SQT, SQR e r2 (Alternativa 2)
# fonte: Adaptado de https://www.geeksforgeeks.org/sum-function-python/
def linreg(X, Y):
    """
    retorna a solu√ß√£o b0 e b1 para a reta y = b0 + b1x e todas as somat√≥rias necess√°rias
    """
    N = len(X)
    Sx = Sy = Sxx = Syy = Sxy = 0.0
    for x, y in zip(X, Y):
        Sx = Sx + x           # Somat√≥ria do termos x
        Sy = Sy + y           # Somat√≥ria do termos y
        Sxx = Sxx + x*x       # Somat√≥ria do termos x^2
        Syy = Syy + y*y       # Somat√≥ria do termos y^2
        Sxy = Sxy + x*y       # Somat√≥ria do termos x vezes y
    det = Sxx * N - Sx * Sx   # vari√°vel auxiliar
    Sxxt= Sxx - Sx*Sx/N       # Termo Sxx
    Sxyt= Sxy - Sx*Sy/N       # Termo Sxy  
    Syyt= Syy - Sy*Sy/N       # Termo Syy  
    r=Sxyt/pow((Sxxt*Syyt), 1/2)
    return (Sxy * N - Sy * Sx)/det, (Sxx * Sy - Sx * Sxy)/det, Sx, Sy, Sxx,  Syy , Sxy, Sxxt, Sxyt, Syyt,r

#obter os valores necess√°rios para calcular SQE e afins
x=df['x']
y=df['y']
b1,b0,sox,soy,sox2,soy2,soxy,sxx,sxy,syy,corr = linreg(x,y)  
#Calcular SQE, SQT e SQR
sqe=syy-b1*sxy
sqt=syy
sqr=sqt-sqe
#calcular r^2 coeficiente de determina√ß√£o
r2=1-sqe/sqt
#Calcular vari√¢ncia estimada
s2=sqe/(len(y)-2)
#Calcular desvio padr√£o estimado
s=pow(s2,1/2)
#Calcular erro padr√£o
ebeta=s/pow(sxx,1/2)

print('b0= {0},b1= {1}'.format(b0,b1))
print('Somat√≥ria x= {0}, Somat√≥ria y= {1},Somat√≥ria xy= {2}'.format(sox,soy,soxy))
print('Somat√≥ria x^2= {0}, Somat√≥ria y^2= {1}'.format(sox2,soy2))
print('Sxx= {0}, Syy {1}, Sxy {2}'.format(sxx,syy,sxy))
print('Coeficiente de correla√ß√£o= {0}'.format(corr))
print('SQE= {0}, SQT {1}, SQR {2}'.format(sqe,sqt,sqr))
print('Vari√¢ncia estimada, s^2= {0}, Desvio padr√£o estimado, s= {1}'.format(s2,s))
print('Coeficente de determina√ß√£o, r^2= {0}, Erro padr√£o, s_b1= {1}'.format(r2,ebeta))

